import React from "react";
import "./Team.css";

function Team() {
  return (
    <>
      <div className="containerProducts">
        <h1 className="product">
          <span>Our</span> Team
        </h1>
      </div>

      <div className="container">
        <h1>Meet Our Team</h1>
        <div className="row">
          {/* Repeating the card 12 times for 12 cards */}
          {[...Array(12)].map((_, index) => (
            <div className="col-md-3 mb-4" key={index}>
              <div className="card border-0" style={{ width: "100%" }}>
                <img
                  src="https://cdn.prod.website-files.com/5beab1239ac8840644a660b4/664496a9b51b0188a4758a2e_Alley-Team-01.png"
                  className="card-img-top"
                  alt="team"
                />
                <div className="card-body">
                  <h5 className="card-title">ds title</h5>
                  <p className="card-text">Some quick example text to build.</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default Team;
